request.description:
**Overview**:  
This endpoint is used to update the subscription of a user. If a subscription type is provided in the request body along with the token, the user's subscription will be updated to the provided type. If no subscription type is provided, the current subscription of the user will be returned.

#### Endpoint

`POST /api/subscription`

**Request Body:**

{  
"subscription": "new_subscription" // Optional: Provide new subscription type to update user subscription  
}

**Response:**

{  
"info": "Subscription updated to new_subscription",  
"token": "NEW_JWT_TOKEN_WITH_UPDATED_SUBSCRIPTION"  
}

